import React from 'react';

// Import images
import WomanImg  from '../img/home/woman.png'; // Adjust this path if needed


// Import link
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <section className='section bg-blue-200'>
      <div className='container mx-auto h-full relative'>
        {/* Text and image wrapper */}
        <div className='flex flex-col justify-center'>
          {/* Text */}
          <div className='w-full pt-36 pb-14 lg:pt-0 lg:pb-0 lg:w-auto z-10 flex flex-col justify-center items-center lg:items-start'>
            <h1 className='h1'>Photographer <br /> & Film Maker</h1>
            <p className='text-[26px] lg:text-[36px] font-primary mb-4 lg:mb-12'>Los Angeles</p>
            <Link to='/contact' className='btn mb-[30px]'>Hire me</Link>
          </div>
          {/* Image */}
          <div className='flex justify-end'>
            <img src = {WomanImg} alt="Photographer" />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
